import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-crew-list',
  templateUrl: './crew-list.page.html',
  styleUrls: ['./crew-list.page.scss'],
})
export class CrewListPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

  crews: any[] = [
    {
      title: 'Crew 1',
      description: 'This is the description for Card 1.',
      image: 'https://www.eventbrite.co.uk/blog/wp-content/uploads/2022/06/pexels-photo-255488.jpeg'
    },
    {
      title: 'Crew 2',
      description: 'This is the description for Card 2.',
      image: 'https://www.eventbrite.co.uk/blog/wp-content/uploads/2022/06/pexels-photo-255488.jpeg'
    },
    {
      title: 'Crew 3',
      description: 'This is the description for Card 3.',
      image: 'https://www.eventbrite.co.uk/blog/wp-content/uploads/2022/06/pexels-photo-255488.jpeg'
    },
  ];

}
<ion-header>
  <ion-toolbar>
    <ion-title>
      Crew
    </ion-title>
  </ion-toolbar>
</ion-header>


<ion-content>
  <ion-card *ngFor="let crew of crews">
    <img alt="Crew Image" src= "{{ crew.image }}" />
    <ion-card-header>
      <ion-card-title>
        {{ crew.title }}
      </ion-card-title>
    </ion-card-header>

    <ion-card-content>
      {{ crew.description }}
    </ion-card-content>
  </ion-card>
</ion-content>
